const store = configureStore();

class App extends Component { 

  constructor(props){
    super(props)
    this.state={
      places:["mumbai","goa","pune","hyderabad"]
    }
  }

  render(){
    return (
      <div className="App">
        <Provider store={store}>

                {this.state.places.map((place) =>
                  <p>{place}</p>
                )}

                <Router >
                  <Switch>
                  </Switch>
                </Router>

        </Provider>
      </div> 
    );
  }
}

export default App;
